import React, { useState } from "react";
import "./index.css"



const Hooks1 = () => {

const [count , setCount] = useState(0);


const DECREMENT = () => {
    setCount(count + 10)
}


    return (
        <>
        <div className="container">
            <h1>{count}</h1>
            <button onClick={DECREMENT}>CLICK ME</button>
        </div>
        </>
    );
}





export default  Hooks1;
